import React from "react";
import DeleteIcon from "@mui/icons-material/Delete";

const Note = (props) => {
  const deleteNote = () => {
    props.deleteItem(props.id);
  };

  return (
    <div className="note">
      <h3>{props.title}</h3>
      <br />
      <p>{props.content}</p>
      <button className="btn" onClick={deleteNote}>
        <DeleteIcon className="deleteIcon" />
      </button>
    </div>
  );
};

export default Note;
